# 创建 SQL 插入语句
sql_statements = []
for key, json_str in data_strings.items():
    # 分解 key 以获取 group_id 和 uid
    _, group_id, uid = key.split(':')

    # 解析 JSON 数据
    json_data = json.loads(json_str)
    json_config = json.dumps(json_data, ensure_ascii=False)
    
    # 通过引号转义，为 SQL 插入做准备
    escaped_json_config = json.dumps(json_config)[1:-1]

    # 构建 SQL 插入语句
    sql = f"INSERT INTO concernconfig (group_id, uid, config) VALUES ({group_id}, {uid}, '{escaped_json_config}');"
    sql_statements.append(sql)

# 打印所有的 SQL 插入命令
for sql in sql_statements:
    print(sql)